"    <div id=\"topicTitle\">",
"     Patient information: Preventing falls (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/preventing-falls-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H4879712\">",
"      <span class=\"h1\">",
"       Am I at risk of falling?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your risk of falling increases as you grow older. That&rsquo;s because getting older can make it harder to walk steadily and keep your balance. Also, the effects of falls are more serious in older people.",
"     </p>",
"     <p>",
"      Overall, 3 to 4 out of every 10 people over the age of 65 fall each year. Up to 75 percent of people who fracture a hip never recover to the point they were before they had their fracture. If you have fallen in the past, you are at higher risk of falling again.",
"     </p>",
"     <p>",
"      Several things can increase your risk of a fall, including:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Illness",
"       </li>",
"       <li>",
"        A change in the medicines you take",
"       </li>",
"       <li>",
"        An unsafe or unfamiliar setting (for example, a room with rugs or furniture that might trip you, or an area you don&rsquo;t know well)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H4879720\">",
"      <span class=\"h1\">",
"       How can my doctor help me to avoid falling?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor can talk to you about the following things:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Past falls &ndash; It is important to tell your doctor about any times you have fallen or almost fallen. He or she can then suggest ways to prevent another fall.",
"       </li>",
"       <li>",
"        Your health conditions &ndash; Some health problems can put you at risk of falling. These include conditions that affect eyesight, hearing, muscle strength, or balance.",
"       </li>",
"       <li>",
"        The medicines you take &ndash; Certain medicines can increase the risk of falling. These include some medicines that are used for sleeping problems, anxiety, or depression. Adding new medicines, or changing doses of some medicines, can also affect your risk of falling.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      The more your doctor knows about your situation, the better he or she will be able to help you. For example, if you fell because you have a condition that causes pain, your doctor might suggest treatments to deal with the pain. Or if one of your medicines is making you dizzy and more likely to fall, your doctor might switch you to a different medicine. &nbsp; &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H4879728\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. To help keep from falling, you can:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Make your home safer &ndash; To avoid falling at home, get rid of things that might make you trip or slip. This might include furniture, electrical cords, clutter, and loose rugs (",
"        <a class=\"graphic graphic_figure graphicRef72890 \" href=\"mobipreview.htm?19/38/20067\">",
"         figure 1",
"        </a>",
"        ). Keep your home well lit so that you can easily see where you are going. Avoid storing things in high places so you don&rsquo;t have to reach or climb.",
"       </li>",
"       <li>",
"        Wear sturdy shoes that fit well &ndash; Wearing shoes with high heels or slippery soles, or shoes that are too loose can lead to falls. Walking around in bare feet, or only socks, can also increase your risk of falling.",
"       </li>",
"       <li>",
"        Take vitamin D pills &ndash; Taking vitamin D might lower the risk of falls in older people. This is because vitamin D helps make bones and muscles stronger. Your doctor can help you decide how much vitamin D to take.",
"       </li>",
"       <li>",
"        Stay active &ndash; Exercising on a regular basis can help lower your risk of falling. It is best to do a few different activities that help with both strength and balance. There are many kinds of exercise that can be safe for older people. These include walking, swimming, and Tai Chi (a Chinese martial art that involves slow, gentle movements).",
"       </li>",
"       <li>",
"        Use a cane, walker, and other safety devices &ndash; If your doctor recommends that you use a cane or walker, be sure that it&rsquo;s the right size and you know how to use it. There are other devices that might help you avoid falling, too. These include grab bars or a sturdy seat for the shower, and hand rails or treads for the stairs (to prevent slipping).",
"        <br/>",
"        <br/>",
"        If you are at high risk of falling, your doctor might tell you to wear hip protectors. These are pads that you wear on your hips (under your pants). They are meant to keep you from hurting or breaking your hip if you fall, although studies have not clearly shown that they are helpful. There are also alarm buttons that let you call for help if you fall and can&rsquo;t get up.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H4879735\">",
"      <span class=\"h1\">",
"       What should I do if I fall?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you fall, see your doctor right away, even if you aren&rsquo;t hurt. Your doctor can try to figure out what caused you to fall, and how likely you are to fall again. He or she will do an exam and talk to you about your health problems, medicines, and activities. Then he or she can suggest things you can do to avoid falling again.",
"     </p>",
"     <p>",
"      Many older people have a hard time recovering after a fall. Doing things to prevent falling can help you to protect your health and independence.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H4879704\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
