var title_f41_4_42062="CV risk with HTN is lower in women than men";
var content_f41_4_42062=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F63561&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F63561&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 614px\">",
"   <div class=\"ttl\">",
"    Hypertensive cardiovascular risk is less in women than men",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 594px; height: 355px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Approximate 10 year risk of cardiovascular disease (CVD) per 100 patients according to severity of hypertension, the number of risk factors, age, and gender. The cardiovascular risk increases with the degree of hypertension, the number of risk factors and age and, when these three factors are equivalent, is substantially less in women.",
"    <div class=\"footnotes\">",
"     * Treatment is indicated in individuals with sustained average blood pressures above 170/100 even if they might have low absolute risk.",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from: Jackson R, Barham P, Bills J, et al, BMJ 1993; 307:107.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
